using Microsoft.VisualStudio.TestTools.UnitTesting;
using DotSetup;

namespace DotSetup_UnitTest
{
    [TestClass]
    public class UIComponents_UnitTest
    {
        string base64ImageExample = @"";
        [TestMethod]
        public void TestPictureBoxEx()
        {
            PictureBoxEx pb = new PictureBoxEx();
            pb.SetImage("","");
            Assert.AreEqual(pb.Image, null, "No relevant image resource");

            pb.SetImage(base64ImageExample, "base64");
            Assert.AreNotEqual(pb.Image, null, "No relevant image resource");
        }

        [TestMethod]
        public void TestPanelEx()
        {
            PanelEx pb = new PanelEx();
            pb.SetImage("", "");
            Assert.AreEqual(pb.BackgroundImage, null, "No relevant image resource");

            pb.SetImage(base64ImageExample, "base64");
            Assert.AreNotEqual(pb.BackgroundImage, null, "No relevant image resource");
        }
    }
}
